    "Fast, modern and advanced photo management suite" : "Conjunto de gerenciamento de fotos rápido, moderno e avançado",
    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **📸 Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **⏪ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **🤖 AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **🫱🏻‍🫲🏻 External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **📱 Mobile Support**: Work from any device, of any shape and size through the web app.\n- **✏️ Edit Metadata**: Edit dates and other metadata on photos quickly and in bulk.\n- **📦 Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **📹 Video Transcoding**: Transcode videos and use HLS for maximal performance.\n- **🗺️ Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **📦 Migration**: Migrate easily from Nextcloud Photos and Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀 Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://demo.memories.gallery/apps/memories/)).\n1. Perform the recommended [configuration steps](https://memories.gallery/config/).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the 📷 Memories app in Nextcloud and set the directory containing your photos." : "# Memórias: Gerenciamento de fotos para Nextcloud\n\nMemórias é uma solução de gerenciamento de fotos *baterias incluídas* para Nextcloud com recursos avançados, incluindo:\n\n- **📸 Linha do tempo**: classifique fotos e vídeos por data de captura, analisados ​​a partir de dados Exif.\n- **⏪ Retroceder**: salte para qualquer momento no passado instantaneamente e reviva suas memórias.\n- **🤖 AI Etiquetas**: agrupe fotos por pessoas e objetos, usando [reconhecer](https://github.com/nextcloud/recognize) e [reconhecimento facial](https://github.com/matiasdelellis/facerecognition)..\n- **🖼️ Álbuns**: crie álbuns para agrupar fotos e vídeos. Em seguida, compartilhe esses álbuns com outras pessoas.\n- **🫱🏻‍🫲🏻 Compartilhamento Externo**: Compartilhe fotos e vídeos com pessoas fora de sua instância do Nextcloud.\n- **📱 Suporte móvel**: Trabalhe em qualquer dispositivo, de qualquer forma e tamanho por meio do aplicativo da web.\n- **✏️ Editar metadados**: Edite datas e outros metadados em fotos rapidamente e em massa\n- **📦 Arquivo**: armazene as fotos que você não deseja ver em sua linha do tempo em uma pasta separada.\n- **📹 Transcodificação de vídeo**: transcodifique vídeos e use HLS para desempenho máximo.\n- **🗺️ Mapa**: visualize suas fotos em um mapa, marcado com geocodificação reversa precisa\n- **📦 Migração**: migre facilmente do Nextcloud Photos e do Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀Instalação\n\n1. Instale o aplicativo na loja de aplicativos Nextcloud (experimente uma demonstração [aqui](https://demo.memories.gallery/apps/memories/)). 1. Execute as [etapas de configuração] recomendadas (https://memories.gallery/config/).\n1. 1. Execute `php occ memórias:index` para gerar índices de metadados para fotos existentes.\n1. Abra o 📷 app Memórias no Nextcloud e defina o diretório que contém suas fotos.",
